import React from 'react';

function SymbolCard() {
  return (
    <div className="card">
      <div className="scale"></div>
      <div className="body">
        <div className="symbol-name">
          title
        </div>
        <div className="current-price"></div>
        <div className="splits"></div>
      </div>
    </div>
  );
}

export default SymbolCard;
